import React,{ Component } from "react";

const Book = ({
    id,
    name,
    details,
    info,
}) => {
        return (
            <>
            <div>{id}</div>
            <div>{name}</div>
            <div>{details}</div>
            <div>{info}</div>
            </>
        )
}

export default Book;
